import React, {Component} from 'react';


class DisplayList extends Component {

    render() {
        return (
            <div>
                {this.props.list.map(item =>
                    <li>
                        <h2 style={{margin:'20px'}}>
                        {item.name}
                        </h2>
                        <h4 style={{margin:'20px'}}>
                        {item.album}
                        <button style={{margin:'40px'}}>asdj</button>
                        </h4>

                        <button>asdj</button>
                    </li>


                )}
            </div>
        )
    }
}

export default DisplayList
